import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Hero from '../components/Hero';
import Views from '../assets/outside5'

function Register() {
  return (
    <>
        <Navbar/>
        <Hero
            cName = "hero-about"
            heroImg = {Views}
            title = "Register Account"
            text = "In order to start booking for your ideal accomodation, you need to register an account with us"
        />
        <Footer/>
    </>
  )
}

export default Register
